import React, { Component } from "react";
import { Container, Row, Col } from 'reactstrap';
import Singlecard from "./FrontItems"
import './mycss/my.css'

export default class FrontItems extends Component {

    render() {
        var item =[];

        this.props.items.forEach(element => {
            console.log("FrontItems for Singlecard")
            console.log(element);
            item.push(<Singlecard sections={element} key={element.id} /> );
            console.log("FrontItems for items")
            console.log(item);
        });

        return ( 
            <div>
                Element Singlecard
                <div>{item}</div>
            </div>
            // console.log(item)
            // // <Singlecard sections={item} />
            // <div>{item}</div>
            // ======================
        );
    }
}
